    date: new Date(),
    exercise: new Month()
  }

  onChange = date => this.setState({ date })

  onClickDay = exercise => this.setState({exercise})
  // onClickDay = exercise => alert('Clicked day: ', exercise)


  render() {
    return (
      <div>
        <Calendar
          onChange={this.onChange}
          value={this.state.date}
          onClickDay={this.OnClickDay} />
        <div className="popup">
            hej
        </div>
      </div>
    )
  }

}

